import React, { useEffect, useState } from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

const containerStyle = {
  width: '800px',
  height: '400px',
  borderRadius: '5px',
};

const center = {
  lat: 32,
  lng: 20,
};

const locations = [
  { name: 'United States', lat: 37.0902, lng: -95.7129 },
  { name: 'Europe', lat: 54.5260, lng: 15.2551 },
  { name: 'Asia', lat: 34.0479, lng: 100.6197 },
  { name: 'Australia', lat: -25.2744, lng: 133.7751 },
  { name: 'Canada', lat: 56.1304, lng: -106.3468 },
];

export default function MarketWatch() {
  const [apiKey, setApiKey] = useState('');
  const [error, setError] = useState(null);
  const [marketStatus, setMarketStatus] = useState({}); // Track market status for each location

  const markets = [
    { name: 'United States', index: 'S&P 500' },
    { name: 'Europe', index: 'Euro Stoxx 50' },
    { name: 'Asia', index: 'Nikkei 225' },
    { name: 'Australia', index: 'S&P/ASX 200' },
    { name: 'Canada', index: 'S&P/TSX Composite' },
  ];

  useEffect(() => {
    const calculateMarketStatus = () => {
      markets.forEach((market) => {
        fetch(`/api/search-stock?query=${market.index}`)
          .then((response) => {
            if (!response.ok) {
              throw new Error(`Network response was not ok: ${response.status}`);
            }
            return response.json();
          })
          .then((indexData) => {
            // Assuming the backend returns index data with a "performance" field
            const performance = indexData.performance;

            // Determine if the market is up or down (you can define your criteria here)
            const isMarketUp = performance > 0;

            // Update the market status for the location
            setMarketStatus((prevStatus) => ({
              ...prevStatus,
              [market.name]: isMarketUp,
            }));
          })
          .catch((error) => {
            console.error(`Error fetching index data for ${market.name}:`, error);
          });
      });
    };

    // Fetch initial data when the component mounts
    calculateMarketStatus();

    // Set up an interval to periodically recalculate market status
    const interval = setInterval(() => {
      calculateMarketStatus();
    }, 60000); // Update every 1 minute (adjust as needed)

    // Clean up the interval when the component unmounts
    return () => clearInterval(interval);
  }, []);

  return (
    <div>
      <h1>Market Watch</h1>
      <ul>
        {Object.entries(marketStatus).map(([location, isUp]) => (
          <li key={location}>
            {location}:
            <span className={`market-icon ${isUp ? 'green' : 'red'}`}>
              {isUp ? 'Market Up' : 'Market Down'}
            </span>
          </li>
        ))}
      </ul>
      <style>
        {`
          .market-icon {
            display: inline-block;
            width: 16px;
            height: 16px;
            border-radius: 50%;
            margin-left: 8px;
          }

          .green {
            background-color: green;
          }

          .red {
            background-color: red;
          }
        `}
      </style>
      {apiKey ? (
        <LoadScript googleMapsApiKey={apiKey}>
          <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={2}>
            {locations.map((location, index) => (
              <Marker
                key={index}
                position={location}
                title={location.name}
                icon={{
                  // Set the marker icon based on market status
                  url: marketStatus[location.name]
                    ? 'https://www.clipartmax.com/png/middle/182-1827658_pin-png-pin-icon-green.png' // Green marker icon path
                    : 'data:image/jpeg;base64,', // Red marker icon path
                  scaledSize: { width: 32, height: 32 }, // Adjust width and height as needed
                }}
              />
            ))}
          </GoogleMap>
        </LoadScript>
      ) : (
        <p>Loading map...</p>
      )}
    </div>
  );
}
